    <div className="topbar">
     <div className="wrapper">
      <div className="left">
      <style>
    @import url('https://fonts.googleapis.com/css2?family=Bungee&display=swap');
    </style>
      <a href="#intro" className="logo"> Wabi-Sabi.</a>
      </div>

      <div className="right">

      </div>
      </div>
    </div>
  )
}
